 背景     本人以前开服时使用QS商店，必须划一块场地来开设商店，玩家必须到指定地方才能购买，很不方便。    后来尝试了环球市场，所有玩家出售的东西全部堆在一起，很混乱，找一个东西要翻无数页，实际上我服这插件就是个摆设。    玩家之间交易少，经济不流通。






