 插件功能  1. 玩家可自主开店，自行开设收购或者出售店铺，自由定价2. 可设置系统商店，系统出售商店拥有无限的商品，系统收购商店拥有无限的空间。3. 系统收购商店可使用js表达式自定义动态交易税默认的动态交易税，税率会随着玩家当日交易额成比例增长context.cost < 1000000 ? (context.cost * ((context.cost * 0.8 / 1000000 / 2)+0.1)) : ((100000 + 1000000 * 0.8 / 2) + (context.cost - 1000000) * 0.9)4. 强大的销售规则，可限制玩家禁止出售某种物品，或者限制最低售价





 特色  1. 默认使用h2数据库进行存储（无需特殊配置），可在SBP配置文件里换成mysql数据库plugins/springbootplugin/libs/SpringBootPlugin/config.conf2. 所有操作均为异步，不会对服务器造成任何压力3. 店铺默认按交易总额升序，刺激玩家进行交易4.  系统商店采用可自定义的动态税率，最大限度的避免经济泛滥5. 玩家商店固定交易税，可自定义6. 完整的帮助指令，完整的tab补全7. 完善的异常流程提示8. 商品直接使用mod的汉化，提示信息会使用中文的物品名字(原版物品需要自行添加语言文件，详见SBP 的 服务端汉化说明)9. 使用数据库存储，开发时已经考虑了多个服同时读写的情况，所以天然支持跨服只要两个服物品相同就行(本插件对1.7序列化做了特殊处理，只要求有相同物品，不要求数字id相同)10. 配置文件强制使用UTF-8编码，并附有详细的注释，一看就懂11. 更新迅速，发现报错或者bug，会尽快修复12. 支持nbt，mod服随意用



 指令/权限  
OP指令
 指令 只允许玩家执行 需要OP异步 并发等级 描述 权限 /taobao setPrePageButton true true true执行者  设置上一页按钮为手里物品 /taobao setNextPageButton true true true 执行者 设置下一页按钮为手里物品  /taobao setGoBackMenuButton true true true 执行者 设置返回主菜单按钮为手里物品  /taobao setRefreshButton true true true执行者  设置刷新按钮为手里物品  /taobao clear <owner> <type> true true true 执行者清空指定商店库存  /taobao addSaleRule 
  [--allowSale=<true|false>] 
  [--matchNbt] 
  [--matchDurability] 
  [--minPrice=<最低售价>] 
  [--ruleId=<规则标识>] 
  [--comment="<备注>"]
true  true true 执行者为手里物品添加销售规则. 
--allowSale: 允许出售(默认true)
--matchNbt: 是否匹配nbt
--matchDurability: 是否匹配耐久值(默认true)
--minPrice=<最低售价>: 指定允许的最低售价
--ruleId=<规则标识>
--comment=\"<备注>\": 备注

玩家指令
指令只允许玩家执行需要OP异步并发等级 描述权限 /taobao createShop <name>truefalsetrue执行者 创建商店 taobao.command.createShop/taobao opentruefalsetrue执行者打开商城 /taobao openShop <owner> <buy|sale> [<page>]truefalsetrue执行者打开指定店铺 /taobao setOrder <商品ID> <移动格数>truefalsetrue执行者 设置商品的序号,商品按序号升序排列taobao.command.setOrder/taobao newSale <价格>truefalsetrue执行者创建新的出售商品 taobao.command.newSale/taobao newBuy <价格> <店铺容量>
truefalsetrue执行者创建新的收购商品 taobao.command.newBuy/taobao deleteShopItem <商品ID> [--force]
truefalsetrue执行者下架指定商品,当指定了 --force 时,强制下架,忽略库存taobao.command.deleteShopItem/taobao setShopName <名字>
truefalsetrue执行者设置店铺名字 taobao.command.setShopName/taobao setIcon
truefalsetrue执行者消耗一个手里物品,并将其设置为店铺图标 taobao.command.setIcon
  

